import React, { Component } from "react";
import { Link } from "react-router-dom";

function HeaderComponent() {
  return (
    <ul>
      <li>
        <Link to="/"> Home </Link>
      </li>
      <li>
        <Link to="/about"> About </Link>
      </li>
      <li>
        <Link to="/team"> Team </Link>
      </li>
    </ul>
  );
}

export default HeaderComponent;
